import './App.css';
import {NavBarC} from "./Navbar/NavBarC";
import {Col, Container, Row} from "react-bootstrap";
import {Menu} from "./Menu/Menu";
import {Schema} from "./Schema/Schema";


function App() {
  return (
    <div className="App">
      <NavBarC/>
        <Container fluid>
            <Row>
                <Col sm={1}>sm=1</Col>
                <Col sm={1}><Menu/></Col>
                <Col sm={10}><Schema/></Col>
            </Row>
        </Container>
    </div>
  );
}

export default App;
